import React from "react";
import "./Footer.css";

function FooterRender() {
  return (
    <footer className="footer text-center bg-dark">
      <div className="container">
        <p className="footer-text">
          Copyright 2020 Khoa Nguyen
        </p>
      </div>
    </footer>
  );
}

export default FooterRender;
